  {id: 10508, name: "Scott v. Harris: The Chase Video", url: "http://www.youtube.com/watch?v=cmx8gzx1N1k", description: "This video contains the recording from Deputy Timothy Scott's police cruiser.  If you want to see the video from another police vehicle involved in the chase, it's available at http://www.youtube.com/watch?v=auw_VAczrTw", public: true, karma: 3, created_at: "2015-07-20 17:08:28", updated_at: "2015-07-20 17:08:28", pushed_from_id: 709, content_type: nil, user_id: 684, ancestry: nil, created_via_import: false},
  {id: 10509, name: "Scott v. Harris \"Why I Ran Video\"", url: "http://www.youtube.com/watch?v=JATVLUOjzvM", description: "This video contains both scenes of the high-speed chase at issue in Scott v. Harris and interviews with both the deputy who made the stop, Timothy Scott, and the driver, Victor Harris.  The relevant material begins at 00:00:14.", public: true, karma: 3, created_at: "2015-07-20 17:08:28", updated_at: "2015-07-20 17:08:28", pushed_from_id: 708, content_type: nil, user_id: 684, ancestry: nil, created_via_import: false},
  {id: 10510, name: "Excerpt from Kahan, Hoffman, and Braman, Whose Eyes Are You Going to Believe?", url: "https://stanford.app.box.com/s/l1jn7kmue8c2ltnjk3ot", description: "This article offers both a theoretical response to, and an empirical test of, the Supreme Court's assertion in Scott v. Harris that no reasonable juror could find that the police used excessive force in stopping Harris's car during a high-speed chase.", public: true, karma: 3, created_at: "2015-07-20 17:08:28", updated_at: "2015-07-20 17:08:28", pushed_from_id: 751, content_type: nil, user_id: 684, ancestry: nil, created_via_import: false},
