  {id: 10512, name: "Consumer Product Safety Commission Safety Alert on Portable Soccer Goals", url: "http://www.cpsc.gov//PageFiles/122381/5118.pdf", description: "An advisory from the government agency responsible for ensuring the safety of a wide range of consumer products.  According to the CPSC's website, \"[d]eaths, injuries, and property damage from consumer product incidents cost the nation more than $1 trillion annually.\"", public: true, karma: 6, created_at: "2015-07-20 17:08:28", updated_at: "2015-07-20 17:08:28", pushed_from_id: 711, content_type: nil, user_id: 684, ancestry: nil, created_via_import: false},
