  {id: 107, name: "Martin C. Libicki, Cyberdeterrence and Cyberwar: Ch. 2: A Conceptual Framework, RAND, 2009", url: "http://www.rand.org/content/dam/rand/pubs/monographs/2009/RAND_MG877.pdf", description: "This chapter outlines three layers of cyberspace: physical, syntactic, and semantic, through which to consider vulnerabilities in cyberspace. It briefly addresses external and internal threats, paying particular attention to the problem of insiders and supply chain concerns.", public: true, karma: 3, created_at: "2012-07-26 17:21:28", updated_at: "2013-05-25 04:58:01", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 10738, name: "Preliminary List of Federal Budget Policy Research Topics for Spring 2016", url: "https://wiki.harvard.edu/confluence/download/attachments/209195768/Preliminary%20List%20of%20Research%20Topics%20for%20Spring%202015.pdf", description: "<p>Historical Topics * The Growth of Executive Budgeting: From the BOB to the OMB Topics Involving Issues of Current Interest * The Law of Gift Accounts and Revolving Accounts * The Meaning of Regular Order and its Application * The Scope of and Case for Grand Bargains * Guaranteeing Social Security Retirement Benefits: Funding Levels &amp; Legal Protections * Social Security Disability Fund Status and Restoration Proposals * Student Loan Forgiveness: Current Practices and Legal Limits * Litigation over DC Spending Reforms * The Impact of Presidential Budget Recommendations on Spending Outcomes * Democracy Deficits in Federal Budget Procedures Updates on Prior Briefing Papers * Update on Earmarks * Update on Debt Ceiling Practices: Accelerated Preparations * Update on Government Shutdowns: The Law and the Workarounds</p>", public: true, karma: nil, created_at: "2015-08-19 14:13:24", updated_at: "2016-06-03 18:01:17", pushed_from_id: 7048, content_type: "text", user_id: 716, ancestry: nil, created_via_import: false},
