  {id: 14, name: "Jose MA. Emmanuel A. Caral, \"Lessons from ICANN: Is self-regulation of the Internet fundamentally flawed?\", International Journal of Law and Information Technology, vol. 12, no. 1, pp. 1-31. 2004", url: "http://ijlit.oxfordjournals.org/content/12/1/1.abstract", description: "The paper discusses the overall benefits and negatives of self-regulation, using ICANN as the center of the discussion and comparing it to the IETF and W3C.", public: true, karma: 3, created_at: "2012-07-27 20:32:31", updated_at: "2013-05-22 07:46:08", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 118, name: "International Corporation for Assigned Names and Numbers, Memorandum of Understanding, November 1998", url: "https://www.icann.org/en/about/agreements/mou-jpa/icann-mou-25nov98-en.htm", description: "This MOU between the Department of Commerce (DOC) and ICANN sets out that ICANN will provide expertise and advice regarding DNS, such as the allocation of IP number blocks and coordination of the assignment of other technical parameters to maintain internet connectivity.", public: true, karma: 3, created_at: "2012-07-26 16:57:53", updated_at: "2013-05-25 04:58:05", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 160, name: "International Corporation for Assigned Names and Numbers, Affirmation of Commitments, September 2009", url: "http://www.icann.org/en/about/agreements/aoc/affirmation-of-commitments-30sep09-en.htm", description: "This document affirms commitments by the DOC and ICANN, including: (a) the global technical coordination of the DNS is accountable, transparent, and in the public interest; (b) the security, stability and resiliency of the DNS is preserved; (c) competition, trust, and choice in the DNS marketplace continues; and (d) international participation in DNS coordination is facilitated.", public: true, karma: 3, created_at: "2012-07-26 16:58:37", updated_at: "2013-07-26 17:35:52", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
