  {id: 8971, name: "5 U.S.C. §§ 551 challenge to the EPA (not responding to ammonia gas pollution petition)", url: "http://environmentalintegrity.org/wp-content/uploads/EIP-lawsuit-against-EPA.pdf", description: "<p>5 U.S.C. &sect;&sect; 551 challenge to the EPA for failing to respond to a petition arguing that ammonia gas pollution (NH3) endangers public health and welfare, to designate ammonia as a CAA &ldquo;criteria pollutant&rdquo; under CAA &sect; 108, and to establish National Ambient Air Quality Standards (NAAQS) for ammonia in the ambient air to protect public health and welfare with an adequate margin of safety under CAA &sect; 109.</p>", public: true, karma: nil, created_at: "2015-02-20 23:25:59", updated_at: "2015-02-20 23:26:24", pushed_from_id: nil, content_type: "text", user_id: 101023, ancestry: nil, created_via_import: false},
