  {id: 124, name: "Steven Levy, Crypto Ch. 3: Public Key, 2001", url: "http://books.google.com/books?id=VOxpXwHmQMgC&printsec=frontcover&source=gbs_ge_summary_r&cad=0#v=onepage&q&f=false", description: "This book traces the history of modern cryptography and how it transferred from being a tool employed by governments to a public service designed and consumed by private actors. Chapter 3 describes how researchers sought to answer the following question: how can you create a system where people who have never met can speak securely? The answer is a one-way authentication system, now popularized as public and private keys.", public: true, karma: 3, created_at: "2012-07-26 16:58:00", updated_at: "2013-05-25 04:58:08", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 164, name: "Introduction to Public-Key Cryptography, Mozilla Developer Network, 2005", url: "https://developer.mozilla.org/en/Introduction_to_Public-Key_Cryptography", description: "Public-key cryptography and related standards and techniques underlie many commonly used security features, including signed and encrypted email, form signing, object signing, single sign-on, and the Secure Sockets Layer (SSL) protocol. This document introduces the basic concepts of public-key cryptography.", public: true, karma: 3, created_at: "2012-07-26 16:58:47", updated_at: "2013-07-26 17:36:01", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
