  {id: 136, name: "Richard Clarke and Robert Knake, Cyber War: The next Threat to National Security and What to Do About It, 2010", url: "http://cyber.law.harvard.edu/cybersecurity/Cyber_War", description: "Cyber War goes behind the \"geek talk\" of hackers and computer scientists to explain clearly and convincingly what cyber war is, how cyber weapons work, and how vulnerable we are as a nation and as individuals to the vast and looming web of cyber criminals.", public: true, karma: 3, created_at: "2012-08-10 20:39:10", updated_at: "2013-06-12 06:09:32", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 214, name: "Joel Brenner, America the Vulnerable: Inside the New Matrix of Digital Espionage, Crime, and Warfare, 2011", url: "http://books.google.com/books?id=UVKo2YoOQrEC&printsec=frontcover&source=gbs_ge_summary_r&cad=0#v=onepage&q&f=false", description: "This book begins by describing how electronic data has become “ambient”-- all electronic activities are aggregated as data, behavior patterns are identiﬁed, and the resulting information is used per the needs of whoever has the data. Brenner argues that the most vulnerable part of any network is the user, however particular attention is also given to operational infrastructure systems.", public: true, karma: 3, created_at: "2012-08-10 20:45:32", updated_at: "2013-09-10 13:52:00", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
