  {id: 13740, name: "[Amendments to the settlement agreement] Plaintiffs' memorandum in support of motion for preliminary approval of *amended* class settlement", url: "http://www.thepublicindex.org/wp-content/uploads/sites/19/docs/amended_settlement/memo_in_support.pdf", description: "<p>Read pp. 1-12.</p>", public: true, karma: nil, created_at: "2016-02-20 19:57:58", updated_at: "2016-02-22 18:20:09", pushed_from_id: nil, content_type: "text", user_id: 101356, ancestry: nil, created_via_import: false},
  {id: 138, name: "David Clark, The Design Philosophy of the DARPA Internet Protocols, ACM SIGCOMM Computer Communication Review, 1988", url: "http://dl.acm.org/citation.cfm?id=52336", description: "<i>Journal Article, 8pg.</i> This paper captures some of the early reasoning which shaped the Internet protocol suite, TCP/IP, when it was first developed by DARPA.", public: true, karma: 3, created_at: "2012-07-26 16:28:13", updated_at: "2013-06-12 06:09:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 140, name: "Lawrence Lessig, Code 2.0, Ch. 4: Architectures of Control, 2006", url: "http://codev2.cc/download+remix/Lessig-Codev2.pdf", description: "This chapter demonstrates how the architecture of the Internet shapes the way we use it and the possibilities of regulation--code is law. The original design was not concerned with control and pushed complexity to the edges of the network. The trade-off between security, control, privacy, and connectivity is decided, to a certain extent, at the architecture level.", public: true, karma: 3, created_at: "2012-07-26 16:40:14", updated_at: "2013-06-12 06:09:37", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 491, name: "David G. Post, In Search of Jefferson’s Moose, Ch. 1: Chaos, 2009", url: "http://books.google.com/books?id=8Y9bLgrZ4xIC&printsec=frontcover&source=gbs_ViewAPI#v=onepage&q&f=false", description: "This book provides a conceptual framework through which newcomers can begin investigating the cyber-frontier. Rather than providing a technical understanding of the elements of the network, it poses some critical questions for understanding how cyberspace works and who makes the rules in cyberspace. This set of questions provides a useful framework to keep in mind while diving into the more technical sections.", public: true, karma: 3, created_at: "2012-08-09 17:05:12", updated_at: "2013-06-12 06:08:11", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
