  {id: 162, name: "David Clark and Susan Landau, Untangling Attribution, Proceedings of a Workshop on Deterring CyberAttacks: Informing Strategies and Developing Options for U.S. Policy, 2010", url: "http://sites.nationalacademies.org/xpedio/groups/cstbsite/documents/webpage/cstb_059365.pdf", description: "Attribution on the Internet can mean the owner of the machine, the physical location of the machine, or the individual who is actually responsible for the actions. This paper teases apart the attribution problems in order to determine under which circumstances which types of attribution would actually be useful.", public: true, karma: 3, created_at: "2012-08-10 20:37:35", updated_at: "2013-07-26 17:35:55", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
