  {id: 16515, name: "Copyright and Cultural Institutions: Guidelines for Digitization for U.S. Libraries, Archives, and Museums", url: "http://hdl.handle.net/1813/14142", description: "<p>\"The development of new digital technologies has led to fundamental changes in the ways that cultural institutions fulfill their public missions of access, preservation, research, and education. Many institutions are developing publicly accessible Web sites that allow users to visit online exhibitions, search collection databases, access images of collection items, and in some cases create their own digital content. Digitization, however, also raises the possibility of copyright infringement. It is imperative that staff in libraries, archives, and museums understand fundamental copyright principles and how institutional procedures can be affected by the law. &lsquo;Copyright and Cultural Institutions&rsquo; was written to assist understanding and compliance with copyright law. It addresses the basics of copyright law and the exclusive rights of the copyright owner, the major exemptions used by cultural heritage institutions, and stresses the importance of &lsquo;risk assessment&rsquo; when conducting any digitization project. Case studies on digitizing oral histories and student work are also included.\"</p>", public: true, karma: nil, created_at: "2016-05-16 11:31:01", updated_at: "2016-07-01 01:41:59", pushed_from_id: 9606, content_type: "text", user_id: 42359, ancestry: nil, created_via_import: false},
