  {id: 168, name: "Richard Clarke and Robert Knake, Cyber War: The next Threat to National Security and What to Do About It, 2010", url: "http://cyber.law.harvard.edu/cybersecurity/Cyber_War", description: "Cyber War goes behind the \"geek talk\" of hackers and computer scientists to explain clearly and convincingly what cyber war is, how cyber weapons work, and how vulnerable we are as a nation and as individuals to the vast and looming web of cyber criminals.", public: true, karma: 3, created_at: "2012-07-27 19:26:07", updated_at: "2013-07-26 17:36:26", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
