  {id: 508, name: "Joel Brenner, America the Vulnerable: Inside the New Matrix of Digital Espionage, Crime, and Warfare, 2011", url: "http://books.google.com/books?id=UVKo2YoOQrEC&printsec=frontcover&source=gbs_ge_summary_r&cad=0#v=onepage&q&f=false", description: "This book begins by describing how electronic data has become “ambient”-- all electronic activities are aggregated as data, behavior patterns are identiﬁed, and the resulting information is used per the needs of whoever has the data. Brenner argues that the most vulnerable part of any network is the user, however particular attention is also given to operational infrastructure systems.", public: true, karma: 3, created_at: "2012-07-27 19:55:22", updated_at: "2013-06-12 06:08:54", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
