  {id: 190, name: "Bruce Schneier, Lessons from the DNS Bug: Patching Isn’t Enough, Wired, Jul 23, 2008", url: "http://www.wired.com/politics/security/commentary/securitymatters/2008/07/securitymatters_0723", description: "This article discusses a DNS bug discovered in 2008 and argues that designing systems with a security mindset would account for vulnerabilities before they surface, rather than the retroactive engineering of patches.", public: true, karma: 3, created_at: "2012-07-26 17:28:10", updated_at: "2013-09-10 01:59:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 191, name: "Callegati, F., Man-in-the-Middle Attack to the HTTPS Protocol, Security & Privacy, IEEE, 2009", url: "http://ieeexplore.ieee.org/xpls/abs_all.jsp?arnumber=4768661", description: "The  man-in-the-middle attack exploits the fact that the HTTPS server (a protocol which guarantees privacy and security in transactions) sends a certificate with its public key to the Web browser. If this certificate isn’t trustworthy, the entire communication path is vulnerable. This article demonstrates how attackers can successfully intercept the data transfer and corrupt the safety of the communication.", public: true, karma: 3, created_at: "2012-07-26 17:28:37", updated_at: "2013-09-10 01:59:33", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 212, name: "Seth Schoen, The Message of Firesheep:”Baaaad Websites, Implement Sitewide HTTPS Now!”, EFF, Oct 29, 2010", url: "https://www.eff.org/deeplinks/2010/10/message-firesheep-baaaad-websites-implement", description: "Firesheep, a software taking advantage of packet sniffing and cookie stealing to hijack sessions on websites such as Facebook and Paypal while using the same network as the victim’s, has caused much discussion regarding the need to implement HTTPS universally across session-based platforms.", public: true, karma: 3, created_at: "2012-07-26 17:29:11", updated_at: "2013-09-10 13:51:59", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
