  {id: 19422, name: "Declaration on the Establishment of a New International Economic Order, UN Gen. Ass. Res. 3201 (1974)", url: "https://perma.cc/H7K6-YJBC", description: "", public: true, karma: nil, created_at: "2016-08-17 21:30:08", updated_at: "2016-08-17 21:30:08", pushed_from_id: nil, content_type: "text", user_id: 110504, ancestry: nil, created_via_import: false},
  {id: 76, name: "Kugler, Richard L., Cyberpower and National Security, Ch. 13: Deterrence of Cyber Attacks, eds. Kramer, Starr, and Wentz, 2009", url: "http://cyber.law.harvard.edu/cybersecurity/Cyberpower_and_National_Security", description: "This chapter rejects the view that the “attribution problem” paralyzes any attempt to develop a cyber deterrence strategy. It focuses on cases in which an adversary will make itself known because a cyber threat is posed to advance a different political goal.", public: true, karma: 3, created_at: "2012-07-27 20:12:00", updated_at: "2013-06-12 06:08:32", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 194, name: "Martin C. Libicki, Cyberdeterrence and Cyberwar: Ch. 3: Why Cyberdeterrence is Different , RAND, 2009", url: "http://www.rand.org/content/dam/rand/pubs/monographs/2009/RAND_MG877.pdf", description: "This chapter discusses cyberdeterrence and explains its profound difference from nuclear deterrence. It argues that because cyberspace is so different a medium, the concepts of deterrence and war may simply lack the logical foundations that they have in the nuclear and conventional realms.", public: true, karma: 3, created_at: "2012-07-27 20:09:05", updated_at: "2013-06-25 21:08:20", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
