  {id: 19483, name: "HLS Preemption Case Study -- Revised for Fall of 2016", url: "https://wiki.harvard.edu/confluence/download/attachments/204380235/HLS%20Preemption%20Case%20Study%20Revised%20for%20Fall%202016%20with%20Appendices.pdf", description: "<p>This case study is appropriate for use in conjunction with Chapter 1.4. It explore the jurisdictional line between the federal laws governing national banks and state consumer protection regulation.</p>", public: true, karma: nil, created_at: "2016-09-06 20:41:42", updated_at: "2017-01-31 19:33:21", pushed_from_id: nil, content_type: "text", user_id: 105314, ancestry: nil, created_via_import: false},
