  {id: 19489, name: "HLS Unidentified Financial Institutions Exercise", url: "https://wiki.harvard.edu/confluence/download/attachments/204380235/Unidentified%20Financial%20Institutions%20Case%20Fall%202016.pdf", description: "<p>This case study may be used in connection with Chapter 1.5 -- A Tour of the Balance Sheet.  The exercise includes a number of the balance sheets discussed in that chapter as well as several others. Students are invited to identify the financial institutions presented in a series of unidentified balance sheets and income statements from 2007.   Instructors can obtain additional slides and teaching notes for this exercise from Professor Howell E. Jackson at hjackson@law.harvard.edu.</p>", public: true, karma: nil, created_at: "2016-09-07 12:32:55", updated_at: "2017-01-31 19:34:49", pushed_from_id: nil, content_type: "text", user_id: 105314, ancestry: nil, created_via_import: false},
  {id: 19487, name: "Volcker Alliance, Reshaping the Financial Regulatory System: Long Delayed, Now Crucial (2015)", url: "https://wiki.harvard.edu/confluence/download/attachments/204380235/Reshaping%20the%20Financial%20Regulatory%20System%20-%20The%20Volcker%20Alliance.pdf", description: "<p>This Volcker Alliance Report offers one of the most recent proposals for regulatory reform and summarizes a large number of similarly-spirited proposals that have preceded it.</p>", public: true, karma: nil, created_at: "2016-09-07 12:22:43", updated_at: "2017-01-31 19:35:11", pushed_from_id: nil, content_type: "text", user_id: 105314, ancestry: nil, created_via_import: false},
  {id: 20091, name: "The Department of the Treasury Blueprint for a Modernized Financial Regulatory Structure (March 2008)", url: "https://wiki.harvard.edu/confluence/download/attachments/204380235/Bush%20Administration%20Treasury%20Blueprint%20%28March%202008%29.pdf", description: "This report on regulatory reform was released by the George W. Bush Treasury Department in the Spring of 2008, just before the financial crisis hit.  It represents another approach to regulatory reform. ", public: true, karma: nil, created_at: "2016-12-15 15:42:34", updated_at: "2017-01-31 19:36:13", pushed_from_id: nil, content_type: "text", user_id: 105314, ancestry: nil, created_via_import: false},
  {id: 19488, name: "Chapman and Cutler LLP, The Regulation of Marketplace Lending: A Summary of the Principal Issues (April 2016)", url: "https://wiki.harvard.edu/confluence/download/attachments/204380235/629_Chapman_Marketplace_Lending_Regulation_Issues_041116.pdf", description: "<p>This 2016 memorandum reviews the very large number of potential regulatory perimeters within which marketplace lending might be found to fall.</p>", public: true, karma: nil, created_at: "2016-09-07 12:25:29", updated_at: "2016-09-07 12:25:29", pushed_from_id: nil, content_type: "text", user_id: 105314, ancestry: nil, created_via_import: false},
