  {id: 100, name: "Jeremy Ferwerda, Nazli Choucri, and Stuart Madnick, Institutional Foundations for Cyber Security:  Current Responses and New Challenges, Working Paper CISL# 2011-05, May 2011", url: "http://web.mit.edu/smadnick/www/wp/2011-05.pdf", description: "This article examines the institutions responsible for addressing the security of cyberspace and international relations in the cyber-domain. It highlights emerging challenges while evaluating the strengths and weaknesses of the current institutional framework.", public: true, karma: 3, created_at: "2012-07-26 16:42:07", updated_at: "2013-06-12 06:09:05", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 139, name: "Robert Knake, Internet Governance in an Age of Cyber Insecurity, Council on Foreign Relations, September 2010", url: "http://www.cfr.org/publication/22832/internet_governance_in_an_age_of_cyber_insecurity.html ", description: "This article examines the technological decisions enabling the Internet’s success and vulnerabilities, then outlines an agenda that the United States can pursue with allies on the international stage", public: true, karma: 3, created_at: "2012-07-26 16:35:26", updated_at: "2013-06-12 06:09:35", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 141, name: "Jack Goldsmith, Cybersecurity Treaties: A Skeptical View, Future Challenges in National Security and Law, February 2011", url: "http://media.hoover.org/sites/default/files/documents/FutureChallenges_Goldsmith.pdf", description: "This article explains why international cooperation is considered central to the cybersecurity problem and examines three major hurdles to a global cybersecurity treaty.  It then considers the feasibility of narrower and softer forms of cooperation.", public: true, karma: 3, created_at: "2012-07-26 16:44:21", updated_at: "2013-06-12 06:09:38", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 204, name: "Abraham D. Sofaer, David Clark, and Whitfield Diffie, Cyber Security and International Agreements, Proceedings of a Workshop on Deterring Cyberattacks, pp. 179-206, 2010", url: "http://www.cs.brown.edu/courses/csci1800/sources/lec17/Sofaer.pdf", description: "This piece discusses how the threats to cybersecurity are currently being approached at the private, national, and international level, then demonstrates the potential for increased international cooperation.  It also covers how to fashion effective international initiatives and the difficulties in such negotiations.", public: true, karma: 3, created_at: "2012-07-26 16:45:38", updated_at: "2013-09-10 02:13:01", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
