  {id: 13, name: "Paul Rosenzweig, The Organization of the United States Government and Private Sector for Achieving Cyber Deterrence, Proceedings of a Workshop on Deterring Cyberattacks: Informing Strategies and Developing Options for U.S. Policy, pp. 245-270, 2010", url: "http://www.harvard.edu", description: "This discusses the general taxonomy of deterrence structures and U.S. efforts to develop organizations to provide capabilities amongst the different aspects of deterrence. It also discusses difficulties in cyberspace that give rise to the organizational challenges and provides recommendation for the U.S. government on how to approach these issues in the future.", public: true, karma: 3, created_at: "2012-07-27 20:16:34", updated_at: "2013-05-22 07:46:07", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 54, name: "Abraham D. Sofaer, David Clark, and Whitfield Diffie, Cyber Security and International Agreements, Proceedings of a Workshop on Deterring Cyberattacks, pp. 179-206, 2010", url: "http://www.cs.brown.edu/courses/csci1800/sources/lec17/Sofaer.pdf", description: "This piece discusses how the threats to cybersecurity are currently being approached at the private, national, and international level, then demonstrates the potential for increased international cooperation.  It also covers how to fashion effective international initiatives and the difficulties in such negotiations.", public: true, karma: 3, created_at: "2012-07-27 20:24:50", updated_at: "2013-06-12 06:08:00", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 121, name: "Jeremy Ferwerda, Nazli Choucri, and Stuart Madnick, Institutional Foundations for Cyber Security:  Current Responses and New Challenges, Working Paper CISL# 2011-05, May 2011", url: "http://web.mit.edu/smadnick/www/wp/2011-05.pdf", description: "This article examines the institutions responsible for addressing the security of cyberspace and international relations in the cyber-domain. It highlights emerging challenges while evaluating the strengths and weaknesses of the current institutional framework.", public: true, karma: 3, created_at: "2012-07-27 17:53:17", updated_at: "2013-05-25 04:58:07", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 207, name: "Lawrence B. Solum, Models of Internet Governance, Illinois Public Law Research Paper No. 07-25, U Illinois Law & Economics Research Paper No. LE08-027, September 3, 2008", url: "http://papers.ssrn.com/sol3/papers.cfm?abstract_id=1136825", description: "This article takes a broad view of Internet governance, presenting three central ideas regarding Internet governance and five different models to Internet governance.", public: true, karma: 3, created_at: "2012-07-27 17:47:06", updated_at: "2013-07-29 21:43:02", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
