  {id: 193, name: "David E. Sanger, Obama Ordered Sped Up Wave of Cyberattacks Against Iran, NY Times, Jun 1, 2012", url: "http://www.nytimes.com/2009/03/29/technology/29spy.html?_r=1&hp=&pagewanted=all", description: "An American program of increasingly sophisticated attacks on the computer systems that ran Iran’s main nuclear enrichment facilities, allegedly responsible for production of the Flame cyber collection platform and the Stuxnet cyber weapon.", public: true, karma: 4, created_at: "2012-07-27 19:12:21", updated_at: "2013-11-02 08:18:41", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 295, name: "Olympic Games Case Study - Berkman Cybersecurity Wiki", url: "http://cyber.law.harvard.edu/cybersecurity/Olympic_Games", description: "", public: true, karma: 3, created_at: "2012-08-13 18:19:08", updated_at: "2013-08-05 16:28:45", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 296, name: "Flame Case Study - Berkman Cybersecurity Wiki", url: "http://cyber.law.harvard.edu/cybersecurity/Flame", description: "", public: true, karma: 3, created_at: "2012-08-13 18:19:41", updated_at: "2013-08-05 16:28:47", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 507, name: "Ellen Nakashima et al., U.S., Israel Developed Flame Computer Virus to Slow Iranian Nuclear Efforts, Officials Say, Washington Post, Jun 19, 2012", url: "http://www.washingtonpost.com/world/national-security/us-israel-developed-computer-virus-to-slow-iranian-nuclear-efforts-officials-say/2012/06/19/gJQA6xBPoV_story.html", description: "Flame is malware developed under Olympic Games as a US-Israeli collaboration presumably targeting Iranian nuclear facilities. It is designed to replicate across even highly secure networks, then control everyday computer functions to send data back to its creators.", public: true, karma: 3, created_at: "2012-07-27 19:13:37", updated_at: "2013-06-12 06:08:52", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 302, name: "Department of Defense, Strategy for Operating in Cyberspace, July 2011", url: "http://www.defense.gov/news/d20110714cyber.pdf", description: "This is an overview of the DOD’s five strategic initiatives regarding cyberspace: to treat cyberspace as an operational domain; to employ new defense operating concepts; to partner to enable a whole-of-government cybersecurity strategy; to build robust relationships allies and international partners; and to leverage ingenuity through an exceptional cyber workforce.", public: true, karma: 3, created_at: "2012-07-30 12:46:45", updated_at: "2013-08-05 16:29:36", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 303, name: "The Secretary of Defense, Establishment of a Subordinate Unified U.S. Cyber Command Under U.S. Strategic Command for Military Cyberspace Operations, 23 June 2009", url: "http://www.defense.gov/home/features/2010/0410_cybersec/docs/cyber_command_gates_memo[1].pdf", description: "This document from the Secretary of Defense directed the Commander of U.S. Strategic Command to establish the subordinate unified command, U.S. Cyber Command.  ", public: true, karma: 3, created_at: "2012-07-30 12:50:50", updated_at: "2013-08-05 16:29:38", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 304, name: "Statement of General Keith B. Alexander, Commander, United States Cyber Command, before the House Committee on Armed Services, 23 September 2010", url: "http://www.defense.gov/home/features/2010/0410_cybersec/docs/USCC%20Command%20Posture%20Statement_HASC_22SEP10_FINAL%20_OMB%20Approved_.pdf", description: "This testimony describes what is happening at US Cyber Command by providing an overview of the current status of the command and by describing the plan for moving forward in accomplishing the assigned mission.", public: true, karma: 3, created_at: "2012-07-30 12:58:55", updated_at: "2013-09-10 18:37:52", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 312, name: "William A. Owens, Kenneth W. Dam, and Herbert S. Lin, editors, Committee on Offensive Information Warfare, National Research Council; Technology, Policy, Law, and Ethics Regarding U.S. Acquisition and Use of Cyberattack Capabilities; Pages 161-187, 2009", url: "http://www.nap.edu/catalog.php?record_id=12651", description: "This document discusses cyberattacks in the context of U.S. military doctrine, the DoD’s organization, rules of engagement, operational planning, human capital, and weapons systems acquisition.  It also provides both historical perspective (1999 and on) and hypothetical examples to support its arguments.  ", public: true, karma: 3, created_at: "2012-07-30 13:16:12", updated_at: "2013-07-29 21:43:05", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 319, name: "Department of Defense Cyberspace Policy Report, November 2011", url: "http://www.defense.gov/home/features/2011/0411_cyberstrategy/docs/NDAA%20Section%20934%20Report_For%20webpage.pdf", description: "This document identifies five distinct, but interrelated strategic initiatives to support DoD’s cyberspace operations and its national security mission:  Treating cyberspace as an operational domain; employing new defense operating concepts to protect DoD networks and systems;  partnering closely with other U.S. Government departments and agencies and the private sector; building robust relationships with U.S. Allies and international partners to enable information sharing; leveraging the Nation’s ingenuity by recruiting and retaining an exceptional cyber workforce and enabling rapid technological innovation. ", public: true, karma: 3, created_at: "2012-07-30 13:02:40", updated_at: "2013-07-31 19:16:37", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 20944, name: "[Missing annotated Case #3600]", url: "https://h2o.law.harvard.edu/collages/10069", description: nil, public: true, karma: nil, created_at: "2017-07-17 08:57:46", updated_at: "2017-07-17 08:57:46", pushed_from_id: nil, content_type: nil, user_id: 0, ancestry: nil, created_via_import: false},
  {id: 6005, name: "Martin Williams, “Germany 'spied' on John Kerry and Hillary Clinton – Der Spiegel,” The Guardian (Aug 16, 2014)", url: "http://perma.cc/H873-A4DP", description: "", public: true, karma: nil, created_at: "2014-12-22 10:47:16", updated_at: "2014-12-22 10:47:16", pushed_from_id: nil, content_type: "text", user_id: 101121, ancestry: nil, created_via_import: false},
  {id: 316, name: "NIST Computer Security Division", url: "http://csrc.nist.gov/about/index.html", description: "One of six divisions in the NIST Information Technology Lab, CSD’s mission is to provide standards and technology to protect information systems against threats to the confidentiality of information, integrity of information and processes, and availability of information and services in order to build trust and confidence in Information Technology (IT) systems.", public: true, karma: 3, created_at: "2012-07-30 13:36:51", updated_at: "2013-07-31 19:16:30", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 335, name: "NIST Establishes National Cybersecurity Center of Excellence, 21 February 2012", url: "http://www.nist.gov/itl/csd/nccoe-022112.cfm", description: "On 21 February 2012, NIST announced a new partnership to establish the National Cybersecurity Center of Excellence, a public-private collaboration for accelerating the widespread adoption of integrated cybersecurity tools and technologies. ", public: true, karma: 3, created_at: "2012-07-30 13:40:37", updated_at: "2013-07-22 18:52:48", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 85, name: "Office of the National Counterintelligence Executive, Foreign Spies Stealing US Economic Secrets in Cyberspace, Report to Congress on Foreign Economic Collection and Industrial Espionage, 2009-2011, October, 2011", url: "http://www.washingtonpost.com/world/national-security/us-israel-developed-computer-virus-to-slow-iranian-nuclear-efforts-officials-say/2012/06/19/gJQA6xBPoV_story.html", description: "Cyberspace provides relatively small-scale actors an opportunity to become players in economic espionage. Underresourced governments or corporations could build relationships with hackers to develop customized malware or remote-access exploits to steal sensitive US economic or technology information. This report gives special attention to foreign collectors’ exploitation of cyberspace, while not excluding other established tactics and methods used in foreign economic collection and industrial espionage.", public: true, karma: 3, created_at: "2012-07-27 19:15:49", updated_at: "2013-06-12 06:08:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 317, name: "Economic Theft Case Studies - Berkman Cybersecurity Wiki", url: "http://cyber.law.harvard.edu/cybersecurity/Category:Case_Studies", description: "", public: true, karma: 3, created_at: "2012-08-13 18:22:25", updated_at: "2013-07-31 19:16:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 313, name: "Homeland Security Presidential Directive 5 , 28 February 2003", url: "http://www.fas.org/irp/offdocs/nspd/hspd-5.html", description: "This directive establishes the DHS as the lead agency to respond to domestic incidents, including acts of terrorism and disasters. ", public: true, karma: 3, created_at: "2012-07-30 13:24:54", updated_at: "2013-07-16 17:56:12", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3983, name: "28 U.S.C. § 2361 - Process and procedure", url: "http://www.law.cornell.edu/uscode/text/28/2361", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:34", updated_at: "2014-08-18 01:31:20", pushed_from_id: 566, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 314, name: "Blueprint for a Secure Cyber Future, DHS, “How We Will Protect Critical Information Infrastructure” and “How We Will Strengthen the Cyber Ecosystem”2, December 2011 ", url: "http://www.dhs.gov/files/publications/blueprint-for-a-secure-cyber-future.shtm", description: "This document provides a path to create a safer,  more resilient cyber environment, and describes two areas for action:  protecting critical information infrastructure and building a stronger cyber ecosystem.  The goals for protecting critical information infrastructure are reducing exposure to cyber risk, ensuring priority response and recovery, maintaining shared situational awareness, and increasing cyber-resilience.  The goals for strengthening the cyber ecosystem are empowering users to operate securely, implementing trustworthy protocols, building collaborative communities, and establishing transparent processes.", public: true, karma: 3, created_at: "2012-07-30 13:25:16", updated_at: "2013-07-31 19:16:26", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 315, name: "Memorandum of Understanding Between the Department of Homeland Security and the National Security Administration Regarding Cyberspace, October 2010", url: "http://www.dhs.gov/xlibrary/assets/20101013-dod-dhs-cyber-moa.pdf", description: "This MoU sets forth terms for the sharing of resources between DHS and NSA to support the U.S. Cybersecurity effort, including the co-locating of both NSA and CYBERCOM units within DHS’s National Cybersecurity and Communications Integration Center.", public: true, karma: 3, created_at: "2012-07-30 13:25:46", updated_at: "2013-07-31 19:16:28", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 333, name: "National Cyber Incident Response Plan, Interim Version, September 2010", url: "http://www.federalnewsradio.com/pdfs/NCIRP_Interim_Version_September_2010.pdf", description: "This document delineates the responsibilities among U.S. agencies in the event of a domestic cyber-incident. It demonstrates the number of agencies involved and the detailed interplay between them. ", public: true, karma: 3, created_at: "2012-07-30 13:24:31", updated_at: "2013-07-31 19:17:11", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 334, name: "The Federal Bureau of Investigation's Ability to Address the National Security Cyber Intrusion Threat, U.S. Department of Justice, Office of the Inspector General, Audit Division., April 2011", url: "http://www.justice.gov/oig/reports/FBI/a1122r.pdf", description: "This report provides an review of the FBI’s cyber capabilities, to include the National Cyber Investigative Joint Task Force (NCIJTF), field office cyber squads, and cyber training policies.  ", public: true, karma: 3, created_at: "2012-07-30 13:29:20", updated_at: "2013-07-22 18:52:46", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
