  {id: 3533, name: "Texas Stat. Code Ann. §166.046", url: "http://www.statutes.legis.state.tx.us/Docs/HS/htm/HS.166.htm", description: "Please read § 166.046", public: true, karma: 3, created_at: "2014-04-09 15:58:27", updated_at: "2014-04-09 16:00:15", pushed_from_id: nil, content_type: "text", user_id: 1052, ancestry: nil, created_via_import: false},
  {id: 355, name: "Communications Security, Reliability and Interoperability Council (CSRIC) III", url: "https://www.fcc.gov/encyclopedia/communications-security-reliability-and-interoperability-council-iii", description: "The CSRIC’s mission is to provide recommendations to the FCC to ensure, among other things, optimal security and reliability of communications systems, including telecommunications, media, and public safety.", public: true, karma: 3, created_at: "2012-07-30 13:44:40", updated_at: "2013-07-22 18:53:12", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 30, name: "Paul Rosenzweig, Cyber Security and Public Goods: The Public/Private “Partnership”, Hoover Institution, 2011", url: "http://media.hoover.org/sites/default/files/documents/EmergingThreats_Rosenzweig.pdf", description: "This article reviews the partnership between Google and the NSA. It argues that the national government cannot be exclusively responsible for providing national cybersecurity. By establishing first economic principles it argues that the  main domain in which government action is effective and desirable is that of fostering the sharing of cybersecurity information.", public: true, karma: 3, created_at: "2012-07-27 20:19:45", updated_at: "2013-06-12 06:07:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 31, name: "Maclean, Don. “Sovereign Right and Dynamics of Power in the ITU: Lessons in the Quest for Inclusive Global Governance” in Drake, William J and Ernest J. Wilson III, eds. Governing Global Electronic Networks. Cambridge: The MIT Press. pp. 84-126, 2008", url: "https://mitpress.mit.edu/catalog/item/default.asp?ttype=2&tid=11600", description: "This book offers the reader perspectives on the governance of global information and communication networks and uncovers the politics that lie beneath global rules and regulations that may seem at first glance to be mainly technical. It shows how the ITU is beset by new challenges from changing technologies and business models, as well as suggesting reforms.", public: true, karma: 3, created_at: "2012-07-26 19:25:22", updated_at: "2013-06-12 06:07:35", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 36, name: "The Cyber Hub, Cyber Power Index, Booz Allen Hamilton and the Economist Intelligence Unit", url: "http://www.cyberhub.com/CyberPowerIndex", description: "An interactive representation of the G20 countries’ cyber power. It allows users to adjust the components of the cyber power index, including: Legal and Regulatory Framework, Economic and Social Context, Technology Infrastructure, Industry Application.", public: true, karma: 3, created_at: "2012-07-27 20:25:49", updated_at: "2013-06-12 06:07:40", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 47, name: "The Internet Engineering Task Force, The Tao of IETF: A Novice's Guide to the Internet Engineering Task Force, 15 October, 2011", url: "https://www.ietf.org/tao.html", description: "This document describes the inner workings of IETF meetings and Working Groups, discusses organizations related to the IETF, and introduces the standards process. It is not a formal IETF process document but instead an informational overview.", public: true, karma: 3, created_at: "2012-07-26 19:01:39", updated_at: "2013-06-12 06:07:51", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 49, name: "Joseph Nye, Cyber Power, Belfer Center, Harvard Kennedy School, May 2010", url: "http://cyber.law.harvard.edu/cybersecurity/Cyber_Power", description: "The characteristics of cyberspace reduce some of the power differentials among actors, and thus provide a good example of the diffusion of power that typifies global politics in this century.", public: true, karma: 3, created_at: "2012-07-27 20:24:57", updated_at: "2013-06-10 16:50:57", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 50, name: "Jeremy Ferwerda, Nazli Choucri, and Stuart Madnick, Institutional Foundations for Cyber Security:  Current Responses and New Challenges, Working Paper CISL# 2011-05, May 2011", url: "http://web.mit.edu/smadnick/www/wp/2011-05.pdf", description: "This article examines the institutions responsible for addressing the security of cyberspace and international relations in the cyber-domain. It highlights emerging challenges while evaluating the strengths and weaknesses of the current institutional framework.", public: true, karma: 3, created_at: "2012-07-26 19:07:16", updated_at: "2013-06-12 06:07:54", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 51, name: "International Telecommunication Union, ITU’s Global Cybersecurity Agenda", url: "http://www.itu.int/osg/csd/cybersecurity/gca/", description: "This site provides ITU’s framework for international cooperation aimed to enhance confidence and security in the cyber domain.", public: true, karma: 3, created_at: "2012-07-26 19:08:00", updated_at: "2013-06-12 06:07:55", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 56, name: "The White House, International Strategy for Cyberspace, May 2011", url: "http://www.whitehouse.gov/sites/default/files/rss_viewer/international_strategy_for_cyberspace.pdf", description: "This document outlines how the United States will work internationally to promote an open, interoperable, secure, and reliable information and communications infrastructure to support international trade and commerce, strengthen international security, and foster free expression and innovation. ", public: true, karma: 3, created_at: "2012-07-27 20:46:06", updated_at: "2013-06-12 06:08:04", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 57, name: "Eric Chabrow, The Cybersecurity Czar Who Wasn't, GovInfo Security, 2 June 2012", url: "http://www.govinfosecurity.com/blogs/cybersecurity-czar-who-wasnt-p-1282/op-1", description: "This piece provides a retrospective on the tenure of Howard Schmidt (White House's first cybersecurity coordinator).  It also provides insight into the cybersecurity coordinator’s role in the administration, as well as challenges inherent to the position.", public: true, karma: 3, created_at: "2012-07-27 20:47:43", updated_at: "2013-06-12 06:08:06", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3936, name: "FRCP 84: Forms", url: "http://www.law.cornell.edu/rules/frcp/rule_84", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2014-08-18 01:25:16", pushed_from_id: 570, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 74, name: "Council of Europe Convention on Cybercrime", url: "http://conventions.coe.int/Treaty/Commun/QueVoulezVous.asp?NT=185&CL=ENG", description: "This Convention was the first international treaty on cybercrime, and deals particularly with copyright, computer fraud, child pornography and network security. Its main objective is to pursue a criminal policy aimed to protect society against cybercrime by adopting appropriate legislation and fostering international cooperation. ", public: true, karma: 3, created_at: "2012-07-27 17:29:36", updated_at: "2013-06-12 06:08:27", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 75, name: "A Comprehensive Inter-American Cybersecurity Strategy", url: "http://www.oas.org/juridico/english/cyb_pry_strategy.pdf", description: "The OAS Cybersecurity Strategy recognizes that protecting networks and information systems is dependent upon: giving operators information to help them secure their networks and respond to incidents; fostering public-private partnerships to increase education of the private sector to secure their infrastructures; stimulating the adoption of standards and practices for information security; and fostering the adoption of cyber-crime policies and legislation to protect users and prevent and deter criminal misuse of computer networks, while respecting users’ privacy.   On June 10, 2003, the OAS General Assembly passed Resolution: AG/RES. 1939 (XXXIII-O/03), on the Development of an Inter-American Strategy to Combat Threats to Cybersecurity.", public: true, karma: 3, created_at: "2012-07-27 17:30:59", updated_at: "2013-06-12 06:08:29", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 77, name: "Business Software Alliance, Center for Democracy & Technology, U.S. Chamber of Commerce, Internet Security Alliance, Tech America,  Improving our Nation’s Cybersecurity through the Public-Private Partnership: a White Paper, Mar 8, 2011", url: "http://www.cdt.org/files/pdfs/20110308_cbyersec_paper.pdf", description: "This paper considers public-private partnerships related to the protection of critical infrastructure. It recommends expanding on existing partnerships in the following areas: risk management, incident management, information sharing and privacy, international engagement, supply chain security, innovation and research and development, and education and awareness.", public: true, karma: 3, created_at: "2012-07-27 20:18:53", updated_at: "2013-06-12 06:08:35", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 86, name: "David Clark and Susan Landau, Untangling Attribution, Proceedings of a Workshop on Deterring CyberAttacks: Informing Strategies and Developing Options for U.S. Policy, 2010.", url: "http://sites.nationalacademies.org/CSTB/CSTB_059365", description: "Attribution on the Internet can mean the owner of the machine, the physical location of the machine, or the individual who is actually responsible for the actions. This paper teases apart the attribution problems in order to determine under which circumstances which types of attribution would actually be useful.", public: true, karma: 3, created_at: "2012-07-27 20:07:43", updated_at: "2013-06-12 06:08:35", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 88, name: "Chitan Vaishnav, Nazli Choucri and David Clarke, Cyber International Relations as an Integrated System, Third International Engineering Symposium, Jun 2012", url: "http://ecir.mit.edu/images/stories/CESUN_2012_Cyber_International_Relations_as_an_Integrated_System_Vaishnav_Choucri_Clark.pdf", description: "International Relations have been traditionally predicated upon the dominance of the State and the effectiveness of geographical boundaries. The Internet has shattered these assumptions. This paper conceptualizes the hitherto separate domains of Cyberspace and International Relations into an integrated socio-technical system.", public: true, karma: 3, created_at: "2012-07-27 20:27:01", updated_at: "2013-06-12 06:08:41", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 9233, name: "PPT Week 3", url: "http://ip-unit.org/wp-content/uploads/2015/03/Seminar-3-presentation-incl-madam-and-eve_for-web.pdf ", description: "", public: true, karma: nil, created_at: "2015-03-19 08:06:55", updated_at: "2015-03-19 16:16:59", pushed_from_id: nil, content_type: "text", user_id: 101093, ancestry: nil, created_via_import: false},
  {id: 122, name: "Elihu Zimet and Edward Skoudis, Cyberpower and National Security, Ch. 4: A Graphical Introduction to the Structural Elements of Cyberspace, eds. Kramer, Starr, and Wentz, 2009", url: "http://cyber.law.harvard.edu/cybersecurity/Cyberpower_and_National_Security", description: "A graphical snapshot of the technological infrastructure, from routers to packets. This chapter provides a more conceptual understanding of the network and the transfer of data.", public: true, karma: 3, created_at: "2012-07-26 16:46:49", updated_at: "2013-05-25 04:58:07", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 177, name: "Mcdowell, Robert M., The U.N. Threat to Internet Freedom, The Wall Street Journal, February 21, 2012", url: "http://online.wsj.com/article_email/SB10001424052970204792404577229074023195322-lMyQjAxMTAyMDIwNjEyNDYyWj.html", description: "This article provides a critical reaction to the treaty talks focused on potentially giving the United Nations unprecedented powers over the Internet through the International Telecommunication Union.", public: true, karma: 3, created_at: "2012-07-26 19:10:33", updated_at: "2013-08-12 20:05:59", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 200, name: "Tyler Moore and Richard Clayton, Examining the Impact of Website Take-down on Phishing, APWG eCrime Researchers Summit, 2007", url: "http://www.ecrimeresearch.org/2007/proceedings/p1_moore.pdf", description: "This article examines take-down times of phishing websites and estimates the cost of a phishing scam in face of the defenders’ efforts to eliminate the attack. It outlines a model of the mechanics of a phishing attack, concluding that by the time phishing sites are removed, damage has already been done: many responses have been received and the attackers are moving on to new sites.", public: true, karma: 3, created_at: "2012-07-26 17:44:00", updated_at: "2013-09-10 01:59:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3930, name: "WHY THE \"HAVES\" COME OUT AHEAD: SPECULATIONS ON THE LIMITS OF LEGAL CHANGE by Marc Galanter", url: "https://wiki.harvard.edu/confluence/download/attachments/208322772/why%20the%20haves%20galanter.pdf", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2016-06-02 22:23:13", pushed_from_id: 590, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
  {id: 201, name: "Hillary Clinton, Remarks on Internet Freedom, U.S. Department of State, Jan 21, 2010", url: "http://www.state.gov/secretary/rm/2010/01/135519.htm", description: "Secretary of State Hillary Rodham Clinton argued that countries and businesses should fight increasing efforts to restrict access to the Internet by repressive governments.\nIn an <a href=\"http://secretaryclinton.wordpress.com/2011/02/15/secretary-of-state-hillary-clintons-speech-on-internet-freedom/\">additional speech</a> February 15, 2011, Clinton addressed China, Iran, and Egypt in particular.", public: true, karma: 3, created_at: "2012-07-27 20:27:28", updated_at: "2013-09-10 01:59:34", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3937, name: "Answer from Washington University v. Catalona.  [SKIM; NOTE DIRECTIONS]", url: "https://wiki.harvard.edu/confluence/download/attachments/208322772/Answering%20from%20Washington%20University.pdf", description: "<p>SKIM the document, spend no more than 15 minutes on it, this is being assigned primarily to show you what an answer looks like.</p>", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2016-06-02 21:56:08", pushed_from_id: 593, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
  {id: 318, name: "Maj. Gen. Charles C. Dunlap, Jr., Perspectives for Cyber Strategists on Law for Cyberwar, Strategic Studies Quarterly, Spring 2011.", url: "http://cyber.law.harvard.edu/cybersecurity/Perspectives_for_Cyber_Strategists_on_Law_for_Cyberwar", description: "Against the argument that existing law in inadequate or lacking entirely within the cybersecurity context, this piece argues that the application of the basic tenets of the existing Law of Armed Conflict (LoAC) to cyber issues are sufficient to address important issues of cyberwar.", public: true, karma: 3, created_at: "2012-07-30 14:10:54", updated_at: "2013-07-31 19:16:35", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3938, name: "FRCP 7", url: "http://www.law.cornell.edu/rules/frcp/rule_7", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2014-08-18 01:25:17", pushed_from_id: 573, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 3939, name: "FRCP 8(b) and (c)", url: "http://www.law.cornell.edu/rules/frcp/rule_8", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2014-08-18 01:25:18", pushed_from_id: 574, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 3940, name: "FRCP 12(a)", url: "http://www.law.cornell.edu/rules/frcp/rule_12", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2014-08-18 01:25:18", pushed_from_id: 575, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 4273, name: "FRCP 6 [SKIM]", url: "http://www.law.cornell.edu/rules/frcp/rule_6", description: "", public: true, karma: nil, created_at: "2014-08-16 12:17:56", updated_at: "2014-08-16 12:17:56", pushed_from_id: nil, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
  {id: 356, name: "Oona A. Hathaway, et al., The Law Of Cyber-Attack, forthcoming in the California Law Review, 2012 ", url: "http://www.law.yale.edu/documents/pdf/cglc/LawOfCyberAttack.pdf", description: "This article examines how existing law may be applied, adapted, and amended to meet the challenges posed by cyber-attacks.  It demonstrates how cyber-attacks relate to existing bodies of law and explains how existing law is deficient but can be improved.", public: true, karma: 3, created_at: "2012-07-30 14:10:04", updated_at: "2013-07-22 18:53:14", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 489, name: "John Savage, Operating Systems and Applications, Lecture slides form CSCI 1800: Cybersecurity and International Relations, Feb 8, 2012", url: "http://www.cs.brown.edu/courses/csci1800/lectures/Lect04_OS_Applications.pdf", description: "", public: true, karma: 3, created_at: "2012-08-09 16:16:53", updated_at: "2013-06-12 06:08:10", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 490, name: "Michael Sechrist, Cyberspace in Deep Water, Harvard Kennedy School, 2010", url: "http://belfercenter.ksg.harvard.edu/files/PAE_final_draft_-_043010.pdf", description: "This policy analysis argues for a public-private partnership in establishing industry best practices for the protection of undersea cables. It provides a light technical overview of how cables work and their significance as part of the ICT infrastructure.", public: true, karma: 3, created_at: "2012-08-09 16:20:54", updated_at: "2013-06-10 16:50:53", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 492, name: "Dave Lee, Sky-high Thinking for African Internet, BBC, Aug 6, 2012", url: "http://www.bbc.co.uk/news/business-19097878", description: "Satellite-powered broadband could be the answer to Africa's connectivity conundrum.", public: true, karma: 3, created_at: "2012-08-09 17:10:52", updated_at: "2013-06-12 06:08:14", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 493, name: "BBC, Lybia Jamming ‘exposed Vulnerability’, Jan 13, 2006", url: "http://news.bbc.co.uk/2/hi/science/nature/4602674.stm", description: "An incident involving Libya blocking a dissident radio station late last year highlighted the potentially devastating consequences of relying too much on satellites, a British MP has warned.", public: true, karma: 3, created_at: "2012-08-09 17:11:32", updated_at: "2013-06-12 06:08:21", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 494, name: "Shin, M., Wireless Network Security and Interworking, Proceedings of the IEEE, Vol. 94 (2), Feb 2006. pp455-466", url: "http://ieeexplore.ieee.org/stamp/stamp.jsp?tp=&arnumber=1580513", description: "", public: true, karma: 3, created_at: "2012-08-09 17:14:47", updated_at: "2013-06-12 06:08:23", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 499, name: "David Clark, An Insider’s Guide to the Internet, 2004", url: "http://groups.csail.mit.edu/ana/Publications/PubPDFs/An-Insiders-Guide-to-the-Internet.pdf", description: "An overview of how the Internet works and why it works the way it does. It provides both a technical introduction and covers some of the design principles that guided the Internet’s initial architecture. The conclusion outlines some implications for policy makers resulting from design: different types of service providers cannot always see the parts of the information that is not relevant to them. That is, an ISP cannot always see the higher level information in the packets (for example, it may be encrypted.); the higher-level service provider (a Web server, for example) cannot see the routing information in the routers, and cannot determine what the topology and capacity of the Internet is. This article also includes a glossary with key terms.", public: true, karma: 3, created_at: "2012-07-26 16:43:18", updated_at: "2013-06-12 06:08:36", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 500, name: "Preston Gralla, How the Internet Works, Ch. 1-10, 8th edition, 2007", url: "http://www.amazon.com/gp/search?index=books&linkCode=qs&keywords=0789736268", description: "A technical, yet accessible illustrated overview of the main building blocks and connection types. The first section, Understanding the Internet’s Underlying Architecture, provides an overview of the Internet, and examines fundamental architectures, protocols, and general concepts. The second section, Connecting to the Internet, looks at the various ways computers can connect to the Internet, and has not been covered by other readings listed in this section. The main takeaway from this introduction is that connecting to the Internet will become increasingly easy—and will occur at increasingly higher speeds.", public: true, karma: 3, created_at: "2012-07-26 16:50:28", updated_at: "2013-06-12 06:08:38", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 501, name: "William A. Owens, Kenneth W. Dam, and Herbert S. Lin, Committee on Offensive Information Warfare, National Research Council; Appendix E: Technical Vulnerabilities Targeted by Cyber Offensive Actions in Technology, Policy, Law, and Ethics Regarding U.S. Acquisition and Use of Cyberattack Capabilities, 2009, pp360-367", url: "http://www.nap.edu/catalog.php?record_id=12651", description: "This short overview covers vulnerabilities pertaining to hardware, software, seams between the two, communications channels, and configuration.", public: true, karma: 3, created_at: "2012-08-09 16:16:04", updated_at: "2013-06-12 06:08:40", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 502, name: "William D. O’Neil, Cyberpower and National Security Ch. 5: Cyberspace and Infrastructure, eds. Kramer, Starr, and Wentz, 2009", url: "http://cyber.law.harvard.edu/cybersecurity/Cyberpower_and_National_Security", description: "This chapter addresses the issue of cyber attacks to electric infrastructure and any form of attack to cyber infrastructure. It provides a brief historical review of infrastructure attacks as well as an outline of threats and possible responses.", public: true, karma: 3, created_at: "2012-07-26 17:25:55", updated_at: "2013-06-12 06:08:44", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 503, name: "Chris Clayton, Standard Cloud Taxonomies and Windows Azure, MSDN, 2011", url: "http://blogs.msdn.com/b/cclayton/archive/2011/06/07/standard-cloud-taxonomies-and-windows-azure.aspx", description: "Cloud solutions come in three main taxonomies: infrastructure as service, platform as service, and software as service. This article reviews the strengths and weaknesses of each taxonomy, demonstrating the trade-off between control, agility, and cost-efficiency.", public: true, karma: 3, created_at: "2012-07-26 17:37:32", updated_at: "2013-06-12 06:08:45", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 3931, name: "FRCP 10(a)", url: "http://www.law.cornell.edu/rules/frcp/rule_10", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:24", updated_at: "2014-08-18 01:25:10", pushed_from_id: 568, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 3978, name: "Federal Rules of Civil Procedure: Rule 14", url: "http://www.law.cornell.edu/rules/frcp/rule_14", description: "", public: true, karma: 3, created_at: "2014-06-23 15:50:34", updated_at: "2014-08-18 01:31:07", pushed_from_id: 560, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
  {id: 504, name: "Harvard Law National Security Research Group, Cloud Computing and National Security Law, 2010", url: "http://sw.cs.nccu.edu.tw/files/Cloud-nationalSecurityLaw.pdf", description: "This report presents a definition of cloud computing, examining both its benefits and drawbacks. Second, it examines legal  challenges posed by cloud computing, with particular attention to implications of cloud computing for U.S. law enforcement and national security agencies. Third, it outlines several recommendations for legislative responses to this new technology.", public: true, karma: 3, created_at: "2012-07-26 17:39:01", updated_at: "2013-06-10 16:50:59", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 505, name: "David Goldman, Massive Gmail Phishing Attack Hits Top U.S. Officials, CNN Money, Jun 1, 2011", url: "http://money.cnn.com/2011/06/01/technology/gmail_hack/index.htm", description: "In the summer of 2011, a major phishing scam originating from China targeted hundreds of personal Gmail accounts, including government officials.", public: true, karma: 3, created_at: "2012-07-26 17:43:29", updated_at: "2013-06-12 06:08:48", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
