  {id: 3612, name: "Copyright term and the public domain in the United States", url: "http://copyright.cornell.edu/resources/publicdomain.cfm", description: "<p><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\">Peter Hirtle,</span><em style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\">&nbsp;Copyright Term and the Public Domain in the United States</em><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\">,</span><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\">&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\">last updated 3 January 2014.</span></p>", public: true, karma: nil, created_at: "2014-06-09 17:39:05", updated_at: "2014-06-09 17:39:05", pushed_from_id: nil, content_type: "text", user_id: 42359, ancestry: nil, created_via_import: false},
