  {id: 3965, name: "Motion to dismiss from Gill v. OPM, D. Mass.", url: "https://wiki.harvard.edu/confluence/download/attachments/208322772/Motion%20to%20dismiss%20from%20Gill%20v.%20OPM.pdf", description: "<p>Read pages (as numbered in the brief) 1-4, 12-18, 21-22, and the Conclusion on 26-27. This reading should take you no more than 25 minutes. I mostly want you to understand the form and not the content, though we may talk a little strategy as well. You can skim as much of the rest as you like.</p>", public: true, karma: 3, created_at: "2014-06-23 15:50:33", updated_at: "2016-06-02 22:19:17", pushed_from_id: 599, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
