  {id: 400, name: "Tyler Moore, et al., The Economics of Online Crime, Journal of Economic Perspectives, Vol 23, No 3, 2009", url: "http://cyber.law.harvard.edu/cybersecurity/The_Economics_of_Online_Crime", description: "This article explains black markets for cyber vulnerabilities, cyber-criminals, cyber-attack tools, money-laundering in the cyber realm, numerous cybercrimes, and the economic incentives of the actors who commit those crimes.", public: true, karma: 3, created_at: "2012-08-03 17:33:10", updated_at: "2013-07-14 22:22:53", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 401, name: "Group IB, State and Trends of the Russian Digital Crime Market, 2011", url: "http://group-ib.com/images/media/Group-IB_Report_2011_ENG.pdf", description: "This report contains the results of the study of the state of the Russian cybercrime market in 2011. It examines the main risks associated with various types of hacker activities, analyzes the main trends in the development of the Russian cybercrime market, estimates the shares and the financial performance of the Russian segment of the global cybercrime market, and forecasts market trends for this year.", public: true, karma: 3, created_at: "2012-08-03 17:35:44", updated_at: "2013-07-08 18:25:47", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
