  {id: 3960, name: "Excerpt from George Neff Stevens, Venue Statutes: Diagnosis and Proposed Cure, 49 MICHIGAN LAW REVIEW 307 (1951)", url: "https://wiki.harvard.edu/confluence/download/attachments/208322772/Excerpt%20from%20George%20Neff%20Stevens%2C%20Venue%20Statutes-%20Diagnosis%20and%20Proposed%20Cure.pdf", description: "<p>You can just skim this. It is meant to familiarize you with all the possible venue rules that we could have, including some that are actually the law in state courts.</p>", public: true, karma: 3, created_at: "2014-06-23 15:50:32", updated_at: "2016-06-02 22:07:20", pushed_from_id: 623, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
