  {id: 4002, name: "Speaking For Itself: The Videotape In Scott v. Harris. [NOTE DIRECTIONS]", url: "http://www.youtube.com/watch?v=qrVKSgRZ2GY", description: "In his dissent, Justice Stevens disagreed with the eight other justices as to the nature of the pursuit in Scott. In response, Justice Scalia wrote: \"We are happy to allow the videotape to speak for itself.\" The Supreme Court then posted the videotape on its website. As you watch the video, consider whether you believe that summary judgment was appropriate in this case.", public: true, karma: 3, created_at: "2014-06-23 15:50:38", updated_at: "2014-08-18 01:34:37", pushed_from_id: 634, content_type: nil, user_id: 571, ancestry: nil, created_via_import: false},
