  {id: 4020, name: "Materials on FRCP 23(a) Certification Requirements from Friedenthal, MIller, et al. (10th ed.) [NOTE DIRECTIONS]", url: "https://wiki.harvard.edu/confluence/download/attachments/208322772/FRCP%2023%28a%29%20Certification%20Requirements%20from%20Friedenthal.pdf", description: "<p>Read all materials, but you can just skim Falcon because it is discussed in Community for Equity case.</p>", public: true, karma: 3, created_at: "2014-06-23 15:50:41", updated_at: "2016-06-02 22:09:20", pushed_from_id: 715, content_type: "text", user_id: 571, ancestry: nil, created_via_import: false},
