  {id: 380, name: "Jack Goldsmith, Cybersecurity Treaties: A Skeptical View, Future Challenges in National Security and Law, February 2011", url: "http://media.hoover.org/sites/default/files/documents/FutureChallenges_Goldsmith.pdf", description: "This article explains why international cooperation is considered central to the cybersecurity problem and examines three major hurdles to a global cybersecurity treaty.  It then considers the feasibility of narrower and softer forms of cooperation.\n<i>Read pages 3-4 for a more skeptical view about the success of the Cybercrime Convention.</i>", public: true, karma: 3, created_at: "2012-08-03 18:58:01", updated_at: "2013-07-14 22:34:01", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 430, name: "The Council of Europe Convention on Cybercrime", url: "http://conventions.coe.int/Treaty/Commun/QueVoulezVous.asp?NT=185&CL=ENG", description: "This Convention was the first international treaty on cybercrime, and deals particularly with copyright, computer fraud, child pornography and network security. Its main objective is to pursue a criminal policy aimed to protect society against cybercrime by adopting appropriate legislation and fostering international cooperation.", public: true, karma: 3, created_at: "2012-08-03 18:51:21", updated_at: "2013-07-14 22:17:20", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 431, name: "Ratifications of Council on Europe Convention on Cybercrime", url: "http://conventions.coe.int/Treaty/Commun/ChercheSig.asp?NT=185&CM=&DF=&CL=ENG", description: "Note how few countries have ratified the treaty.", public: true, karma: 3, created_at: "2012-08-03 19:06:55", updated_at: "2013-07-14 22:17:24", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
