  {id: 432, name: "Michael Vatis, The Council of Europe Convention on Cybercrime, Proceedings of a Workshop on Deterring CyberAttacks: Informing Strategies and Developing Options for U.S. Policy, 2010 ", url: "http://www.cs.brown.edu/courses/csci1950-p/sources/lec16/Vatis.pdf", description: "An introduction to Cybercrime Convention, but more than a little optimistic about its efficacy compared to the scale of the problem.", public: true, karma: 3, created_at: "2012-08-03 19:04:37", updated_at: "2013-07-14 22:12:55", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
