  {id: 443, name: "Roger D. Scott, Territorially Intrusive Intelligence Collection and International Law, 46 Air Force L. Rev. 217, 1999", url: "http://www.afjag.af.mil/shared/media/document/AFD-090108-036.pdf", description: "An older, but still relevant, analysis on the laws regarding intelligence collection.", public: true, karma: 3, created_at: "2012-08-06 15:46:00", updated_at: "2013-06-07 14:39:03", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 469, name: "Jeffrey H. Smith, Keynote Address: State Intelligence Gathering and International Law, 28 Mich. J. Int’l L. 543, 544, 2006", url: "https://litigation-essentials.lexisnexis.com/webcd/app?action=DocumentDisplay&crawlid=1&doctype=cite&docid=28+Mich.+J.+Int'l+L.+543&srctype=smi&srcid=3B15&key=51e6b585333376b66854537d48a827ff", description: "An introduction with application to related national security issues.", public: true, karma: 3, created_at: "2012-08-06 15:48:09", updated_at: "2013-06-12 06:15:48", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 470, name: "National Research Council, Technology, Policy, Law, and Ethics Regarding U.S. Acquisition and Use of Cyberattack Capabilities", url: "http://www.nap.edu/catalog.php?record_id=12651", description: "Ch 7:  pp. 239-292 \n§ 7.2.2.1.5: pp. 259-261, 263", public: true, karma: 3, created_at: "2012-08-06 15:49:08", updated_at: "2013-06-12 06:15:56", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 4954, name: "Human Rights Watch, “Why They Died,” September 2007 [skim online version]", url: "http://www.hrw.org/reports/2007/09/05/why-they-died-0", description: "", public: true, karma: nil, created_at: "2014-10-16 21:23:52", updated_at: "2014-10-16 21:23:52", pushed_from_id: nil, content_type: "text", user_id: 100711, ancestry: nil, created_via_import: false},
  {id: 473, name: "Department of Defense, An Assessment of International Legal Issues in Information Operations, 1999", url: "http://cyber.law.harvard.edu/cybersecurity/An_Assessment_of_International_Legal_Issues_in_Information_Operations", description: "An early and influential DOD analysis that is one of the most comprehensive public documents on DOD thinking about these issues.\n", public: true, karma: 3, created_at: "2012-08-06 15:52:26", updated_at: "2013-06-12 06:16:07", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 471, name: "Patrick Morgan, Applicability of Traditional Deterrence Concepts and Theory to the Cyber Realm, Proceedings of a Workshop on Deterring CyberAttacks: Informing Strategies and Developing Options for U.S. Policy, 2010", url: "http://sites.nationalacademies.org/xpedio/groups/cstbsite/documents/webpage/cstb_059436.pdf", description: "This article is a similar effort to Nye’s that is more focused on the deterrence lessons for cyber from nuclear.", public: true, karma: 3, created_at: "2012-08-06 19:49:01", updated_at: "2013-06-12 06:16:02", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 472, name: "Joseph S. Nye Jr., Nuclear Lessons for Cybersecurity, Strategic Studies Quarterly, Winter 2011", url: "http://www.au.af.mil/au/ssq/2011/winter/nye.pdf", description: "This article summarizes general lessons for cybersecurity from the experience with nuclear weapons.  Nye focuses here on more issues than just deterrence, but the whole piece should be read.  Make sure you read and understand Nye’s point in the end about softer forms of deterrence.", public: true, karma: 3, created_at: "2012-08-06 19:37:48", updated_at: "2013-06-12 06:16:05", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 475, name: "Stephen Lukasik, A Framework for Thinking About Cyber Conflict and Cyber Deterrence with Possible Declaratory Policies for These Domains, Proceedings of a Workshop on Deterring CyberAttacks: Informing Strategies and Developing Options for U.S. Policy, 2010", url: "http://sites.nationalacademies.org/xpedio/groups/cstbsite/documents/webpage/cstb_059438.pdf", description: "This article is more of the same, with a special emphasis on declaratory policy, which is a nation’s unilateral statement of intent (i.e. of threatened action) as a basis for deterrence.", public: true, karma: 3, created_at: "2012-08-06 19:52:00", updated_at: "2013-06-12 06:16:08", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 478, name: "Curtis A. Bradley and Jack L. Goldsmith, Overview of International Law and Institutions in , Foreign Relations Law: Cases and Materials (4th ed. 2011)", url: "http://cyber.law.harvard.edu/cybersecurity/Overview_of_International_Law_and_Institutions", description: "Students may find it useful to acquaint themselves at the outset of this course with the basic sources of international law and some of the most important international institutions. The following is a brief overview.", public: true, karma: 3, created_at: "2012-08-06 21:30:07", updated_at: "2013-06-12 06:16:12", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 444, name: "Agreement of the Governments of the Member States of the Shanghai Cooperation Organization [China, Kazakhstan,Kyrgyzstan, Russia, Tajikistan, and Uzbekistan] on Cooperation in the Field of International Information Security, 2008", url: "http://www.lawfareblog.com/wp-content/uploads/2012/02/SCO-Treaty-on-Cyber.pdf", description: "This agreement shows how differently the Chinese view the cybersecurity issue than the way that the west conceives it.", public: true, karma: 3, created_at: "2012-08-06 20:18:35", updated_at: "2013-06-12 06:15:47", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 474, name: "James Andrew Lewis, Confidence-building and International Agreement in Cybersecurity, United Nations Institute for Disarmament Research, 2011 ", url: "http://www.unidir.org/pdf/articles/pdf-art3168.pdf", description: "This article is skeptical about international agreements but somewhat more hopeful than Goldsmith.", public: true, karma: 3, created_at: "2012-08-06 20:44:24", updated_at: "2013-05-29 23:37:22", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 476, name: "Jack Goldsmith, Cybersecurity Treaties: A Skeptical View, Future Challenges in National Security and Law, February 2011", url: "http://media.hoover.org/sites/default/files/documents/FutureChallenges_Goldsmith.pdf", description: "This article explains why international cooperation is considered central to the cybersecurity problem and examines three major hurdles to a global cybersecurity treaty.  It explains why a cybersecurity agreement of the type Clark and Knake propose might not be feasible, and considers the feasibility of narrower and softer forms of cooperation.", public: true, karma: 3, created_at: "2012-08-06 20:02:10", updated_at: "2013-06-12 06:16:09", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 477, name: "Russian Proposal, Convention on International Information Security, November 2011", url: "http://www.lawfareblog.com/wp-content/uploads/2012/02/russian-draft-cyber-convention.doc", description: "This Convention shows how differently the Russians view the cybersecurity issue than the way the west conceives it.  ", public: true, karma: 3, created_at: "2012-08-06 20:22:02", updated_at: "2013-06-12 06:16:11", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 479, name: "Abraham D. Sofaer, David Clark, and Whitfield Diffie, Cyber Security and International Agreements, Proceedings of a Workshop on Deterring Cyberattacks, pp. 179-206, 2010", url: "http://www.cs.brown.edu/courses/csci1800/sources/lec17/Sofaer.pdf", description: "This piece discusses how the threats to cybersecurity are currently being approached at the private, national, and international level, then demonstrates the potential for increased international cooperation. It explains the demand for cyber international agreements and their feasibility and usefulness.  It also covers how to fashion effective international initiatives and the difficulties in such negotiations.", public: true, karma: 3, created_at: "2012-08-06 20:26:12", updated_at: "2013-06-12 06:16:14", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
  {id: 481, name: "Clark and Knake, Cyber War: The Next Threat to National Security and What to Do About It, Chapter 7, 2010, ISBN: 978-0061962233", url: "https://cyber.law.harvard.edu/cybersecurity/Cyber_War", description: "This chapter proposes a concrete international agreements for the cyber domain.", public: true, karma: 3, created_at: "2012-08-06 20:35:31", updated_at: "2013-06-12 06:16:15", pushed_from_id: nil, content_type: nil, user_id: 344, ancestry: nil, created_via_import: false},
