  {id: 749, name: "\"Amen, Brother\" The Winstons (1969)", url: "http://www.whosampled.com/Amen,-Brother/The-Winstons/", description: "This album has been sampled 894 times since its release in 1969.  Often times the samples taken are simple instrumental loops.  At what point does a sample simply replace an instrument?  In trademark law, something can become so ubiquitous as to be unprotectable. Should a similar policy apply to music sampling?  Would this example qualify?", public: true, karma: 3, created_at: "2013-08-26 23:18:02", updated_at: "2013-08-27 01:34:56", pushed_from_id: nil, content_type: nil, user_id: 604, ancestry: nil, created_via_import: false},
  {id: 750, name: "\"I Shot the Sheriff,\" Eric Clapton (1974) sampled in \"Fight the Power,\" Public Enemy (1989)", url: "http://www.whosampled.com/sample/186617/Public-Enemy-Fight-the-Power-Eric-Clapton-I-Shot-the-Sheriff/", description: "This instance of sampling raises questions about the \"amount and substantiality\" test.  The sampled portion comprises just a single note, but it is quite an identifiable note.  Could the expression of a single note ever be so unique as to be protected by copyright?", public: true, karma: 3, created_at: "2013-08-26 23:36:52", updated_at: "2013-08-28 14:14:10", pushed_from_id: nil, content_type: nil, user_id: 604, ancestry: nil, created_via_import: false},
