  {id: 9581, name: "Collection of Recent Readings on Social Security Disability", url: "http://isites.harvard.edu/fs/docs/icb.topic1379255.files/Collection%20of%20Assorted%20Readings%20on%20Social%20Security%20Disability.pdf", description: "<p>This reading stretch back to 2004 and include a number of perspectives on social security's disability program.&nbsp; There are two large themes: the first concerns the pending insolvency of the SSDI program and the second relates to improprieties in the processing of disability claims.&nbsp; Both areas are subject to reform proposals discussed in these readings.</p>", public: true, karma: nil, created_at: "2015-04-07 19:19:59", updated_at: "2015-04-07 19:19:59", pushed_from_id: nil, content_type: "text", user_id: 716, ancestry: nil, created_via_import: false},
