  {id: 23995, name: "Mark Ronson Takes to the TED Stage to Explain and Explore Music Sampling", url: "https://www.youtube.com/watch?v=H3TF-hI7zKc", description: "Recording artist Mark Ronson is renown for his sampling techniques. This video shows his performance at the TED conference. Including this video is intended to supplement the case law included so anyone viewing this page may have a better idea of what music sampling includes.", public: true, karma: nil, created_at: "2017-07-17 09:00:42", updated_at: "2017-07-17 09:00:42", pushed_from_id: nil, content_type: nil, user_id: 106534, ancestry: nil, created_via_import: false},
  {id: 23996, name: "Unkle's \"Rabbit in Your Headlights\"", url: "https://www.youtube.com/watch?v=dUM97uKfjcM", description: "This music video for the band Unkle features a sample not from another musician but from the film Jacob's Ladder. It demonstrates the complexity of music sampling and legislation behind fair use.", public: true, karma: nil, created_at: "2017-07-17 09:00:42", updated_at: "2017-07-17 09:00:42", pushed_from_id: nil, content_type: nil, user_id: 106534, ancestry: nil, created_via_import: false},
